import './Nav.css'
import house from '../../house.svg'



export const Nav = (props) => {

    return(
        <div>
            <a href="url">
                <img src={house} alt='home' className='houseSVG'></img>
                <h5>Home</h5>
            </a>
        </div>
    )
}
